import React, { Component } from 'react';
import './App.css';
import Modalbutton from './components/modalbutton';
import Header from './components/header';
import Footer from './components/footer';
import Productsmall from './components/productSmall';
// import Button from '@material-ui/core/Button';

class App extends Component {

  buttonHandler = (buttonName) => {
    alert("Button handler " + buttonName.currentTarget.value)
  }

  state = {
    jb: [{
      title: "Doctor No",
      image: "doctor_no.jpg",
      description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas et metus.",
      pricedvd: 9.99,
      priceblu: 14.99,
      stockdvd: 55,
      stockblu: 23},

      {
        title: "From Russia with love",
        image: "russia_with_love.jpg",
        description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas et metus.",
        pricedvd: 9.99,
        priceblu: 14.99,
        stockdvd: 55,
        stockblu: 23},

        {
          title: "Thunderball",
          image: "thunderball.jpg",
          description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas et metus.",
          pricedvd: 9.99,
          priceblu: 14.99,
          stockdvd: 55,
          stockblu: 23},

          {
            title: "You Only Live Twice",
            image: "live_twice.jpg",
            description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas et metus.",
            pricedvd: 9.99,
            priceblu: 14.99,
            stockdvd: 55,
            stockblu: 23},

            {
              title: "O.H.M.S.S.",
              image: "ohmss.jpg",
              description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas et metus.",
              pricedvd: 9.99,
              priceblu: 14.99,
              stockdvd: 55,
              stockblu: 23},

              {
                title: "Diamonds Are Forever",
                image: "diamonds_for_ever",
                description: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas et metus.",
                pricedvd: 9.99,
                priceblu: 14.99,
                stockdvd: 55,
                stockblu: 23}

    ]
   ,
    qtyOfTasks: 0
    }






  render() {

    return (

      <div className="outerdiv">

        <div class="container">
          <div className="maindiv">

            <div className="row banner">
              <Header />
            </div>
            <div className="row">

              <div className="col-sm">
              </div>

              <div className="col-sm centered">
                <Modalbutton
                  buttonHandlerFunction={this.buttonHandler}
                />
              </div>

              <div className="col-sm">
              </div>

            </div>


            <div class="container">
              <div className="row innerarea">
              {
            this.state.jb.map((item, i) => {
              return <Productsmall
                indexkey={i}
                jb={this.state.jb[i]}
                buttonHandlerFunction={this.buttonHandler}
                 />
            })
          }

                {/* <Productsmall jb={this.jb[0]} />
                <Productsmall jb={this.jb[1]} />
                <Productsmall jb={this.jb[2]} /> */}

              </div>
            </div>

            <div className="row">
              <div className="col-sm">
                <Footer />
              </div>
            </div>

          </div>

        </div>
      </div >
    );
  }
}

export default App;
